import React from "react";
import { Link } from "react-router-dom";
import "./style.css";

const Home = () => {
  return (
    <div>
      <div className="intro">
        <p>
          Welcome to Clifftography! This is where I'll be posting all of my best
          work. If you are interested in anything please reach out!
        </p>
      </div>
    </div>
  );
};

export default Home;
